import React, { useState } from "react";
import { View, StyleSheet, TextInput } from "react-native";

const Paginator = {
  render() {
    return (
      <View>
        <View class="container">
          <View class="radio" />
          <View class="radio" />
          <View class="radio" />
        </View>
      </View>
    );
  },
};

const styles = StyleSheet.create({
  radio: {
    marginTop: 20,
    marginBottom: 20,
    opacity: 0,
    height: 24,
    width: 24,
    borderRadius: 12,
    borderWidth: 2,
    borderColor: "#000",
    alignItems: "center",
    justifyContent: "center",
  },
});

export default Paginator;
